import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import MyNavbar from "../components/Navbar";

const Home = () => {
  // Internal CSS styles
  const styles = {
    videoContainer: {
      position: "relative",
      width: "100vw",
      height: "100vh",
      overflow: "hidden",
    },
    video: {
      width: "100%",
      height: "100%",
      objectFit: "cover",
    },
    overlay: {
      position: "absolute",
      top: "0",
      left: "0",
      width: "100%",
      height: "100%",
      backgroundColor: "rgba(0, 0, 0, 0.3)",
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      flexDirection: "column",
      color: "white",
      textAlign: "center",
      padding: "20px",
    },
    heading: {
      fontSize: "3rem",
      fontWeight: "bold",
      marginBottom: "10px",
    },
    subText: {
      fontSize: "1.5rem",
      marginBottom: "20px",
    },

    section: {
      padding: "80px 20px",
      textAlign: "center",
    },
    card: {
      padding: "20px",
      border: "1px solid #ddd",
      borderRadius: "8px",
      margin: "10px",
      boxShadow: "0px 0px 10px rgba(0,0,0,0.1)",
    },
  };

  return (
    <>
      <div>
        <MyNavbar />
        {/* Hero Section */}
        <div style={{ position: "relative" }}>
          {/* Hero Section */}
          <div style={styles.videoContainer}>
            <video style={styles.video} autoPlay loop muted>
              <source src="videos/home.mp4" type="video/mp4" />
              Your browser does not support the video tag.
            </video>

            <div style={styles.overlay}>
              <h1 style={styles.heading}>Welcome to TravelMate</h1>
              <p style={styles.subText}>Discover new adventures with us</p>
              <button style={styles.button}>Explore Now</button>
            </div>
          </div>

          {/* Button Group - Placed Outside the Hero Section */}
          <div
            className="btn-group position-absolute start-50 translate-middle-x"
            role="group"
            style={{
              width: "1200px",
              height: "120px",
              top: "calc(100vh - 50px)", // Moves halfway between sections
              transform: "translateY(-50%)", // Centers the button group across sections
              zIndex: 10, // Ensures it stays visible
            }}
          >
            <button
              className="btn btn-primary btn-lg"
              style={{
                backgroundColor: "white",
                color: "#18C5EF",
                fontWeight: "bold",
                borderColor: "white",
                padding: "10px 20px",
                fontSize: "18px",

                border: "2px solid white",
                transition: "color 0.2s ease-in-out",
                cursor: "pointer",
              }}
              onMouseOver={(e) => {
                e.target.style.color = "green"; // Change button text color
                const icon = e.target.querySelector("i");
                if (icon) icon.style.color = "green"; // Change icon color only if it exists
              }}
              onMouseOut={(e) => {
                e.target.style.color = "#18C5EF"; // Reset text color
                const icon = e.target.querySelector("i");
                if (icon) icon.style.color = "#18C5EF"; // Reset icon color only if it exists
              }}
            >
              <i
                className="bi bi-graph-up me-2 fs-2"
                style={{ color: "#18C5EF" }}
              ></i>
              <br />
              Manage Expenses
            </button>

            <div
              style={{
                width: "2px",
                height: "50px",
                backgroundColor: "#18C5EF",

                alignSelf: "center", // Adjust this value to move it further down
              }}
            ></div>

            <button
              className="btn btn-primary btn-lg"
              style={{
                backgroundColor: "white",
                color: "#18C5EF",
                fontWeight: "bold",
                borderColor: "white",
                padding: "10px 20px",
                fontSize: "18px",

                border: "2px solid white",
                transition: "color 0.2s ease-in-out",
                cursor: "pointer",
              }}
              onMouseOver={(e) => {
                e.target.style.color = "green"; // Change button text color
                const icon = e.target.querySelector("i");
                if (icon) icon.style.color = "green"; // Change icon color only if it exists
              }}
              onMouseOut={(e) => {
                e.target.style.color = "#18C5EF"; // Reset text color
                const icon = e.target.querySelector("i");
                if (icon) icon.style.color = "#18C5EF"; // Reset icon color only if it exists
              }}
            >
              <i
                className="bi bi-chat-dots me-2 fs-2"
                style={{ color: "#18C5EF" }}
              ></i>{" "}
              <br />
              Ask AI
            </button>
            <div
              style={{
                width: "2px",
                height: "120px",
                backgroundColor: "#18C5EF",

                alignSelf: "center", // Adjust this value to move it further down
              }}
            ></div>
            <button
              className="btn btn-primary btn-lg"
              style={{
                backgroundColor: "white",
                color: "#18C5EF",
                fontWeight: "bold",
                borderColor: "white",
                padding: "10px 20px",
                fontSize: "18px",

                border: "2px solid white",
                transition: "color 0.2s ease-in-out",
                cursor: "pointer",
              }}
              onMouseOver={(e) => {
                e.target.style.color = "green"; // Change button text color
                const icon = e.target.querySelector("i");
                if (icon) icon.style.color = "green"; // Change icon color only if it exists
              }}
              onMouseOut={(e) => {
                e.target.style.color = "#18C5EF"; // Reset text color
                const icon = e.target.querySelector("i");
                if (icon) icon.style.color = "#18C5EF"; // Reset icon color only if it exists
              }}
            >
              <i
                className="bi bi-translate me-2 fs-2"
                style={{ color: "#18C5EF" }}
              ></i>{" "}
              <br />
              Translate Now
            </button>
            <div
              style={{
                width: "2px",
                height: "120px",
                backgroundColor: "#18C5EF",

                alignSelf: "center", // Adjust this value to move it further down
              }}
            ></div>
            <button
              className="btn btn-primary btn-lg"
              style={{
                backgroundColor: "white",
                color: "#18C5EF",
                fontWeight: "bold",
                borderColor: "white",
                padding: "10px 20px",
                fontSize: "18px",

                border: "2px solid white",
                transition: "color 0.2s ease-in-out",
                cursor: "pointer",
              }}
              onMouseOver={(e) => {
                e.target.style.color = "green"; // Change button text color
                const icon = e.target.querySelector("i");
                if (icon) icon.style.color = "green"; // Change icon color only if it exists
              }}
              onMouseOut={(e) => {
                e.target.style.color = "#18C5EF"; // Reset text color
                const icon = e.target.querySelector("i");
                if (icon) icon.style.color = "#18C5EF"; // Reset icon color only if it exists
              }}
            >
